import React, { Component, useEffect, useState } from 'react';
import { Container, Col, Image, Row } from 'react-bootstrap';
import './style.css';
import body from './../../Components/Images/Body.png';
import face from './../../Components/Images/jimmyFace.png';
import API from './../../Utils/API';

function ProfilE() {
	const [user, setUser] = useState({
		age: '',
		birthday: '',
		city: '',
		countryofRecidence: '',
		ecMail: '',
		ecName: '',
		ecPhone: '',
		email: '',
		eyeColor: '',
		hairColor: '',
		height: '',
		nacionality: '',
		name: '',
		particularSigns: '',
		password: '',
		photoBody: '',
		photoFace: '',
		skinTone: '',
		state: '',
		street: '',
		streetNumber: '',
		weight: '',
		zipCode: '',
	});
	useEffect(() => {
		loadUser();
	}, []);
	function loadUser() {
		API.getUser()
			.then((res) => {
				console.log(res);
				setUser(res.data[0]);
			})
			.catch((err) => console.log(err));
	}
	console.log(user);
	return (
		<div>
			<h1 className="ProfileName">{user.name}</h1>
			<div className="ProfDiv">
				<Row className="ProfileRow">
					<Container className="ProfileCont1">
						<Col className="ProfileImages">
							<Image className="facePic" src={face} width="300" height="300" />

							<Image className="bodyPic" src={body} width="150" height="350" />
						</Col>

						<p className="userProfI">
							<h2>&nbsp;&nbsp;About You</h2>
							<span className="highText">Age:     </span> {user.age}<br />
							<span className="highText">Birthday:      </span>{user.birthday} <br />
							<span className="highText">Nacionality:       </span>{user.nacionality}<br />
							
							<span className="highText">Eye Color:     </span> {user.eyeColor}
							<br />
							<span className="highText">Hair Color:     </span> {user.hairColor}
							<br />
							<span className="highText">Height:     </span> {user.height} <br />
							<span className="highText">Weight:      </span> {user.weight}<br />
							<span className="highText">Skin Tone:     </span> {user.skinTone}
							<br />
							<span className="highText">Particular signs:     </span> {user.particularSigns}
							<br />
							<h2>&nbsp;&nbsp;Adress:</h2>
							<span className="highText">Number:     </span> {user.streetNumber}
							<br />
							<span className="highText">Street:     </span> {user.street}
							<br />
							<span className="highText">City:     </span> {user.city} <br />
							<span className="highText">State:     </span> {user.state} <br />
							<span className="highText">Zip Code:    </span>  {user.zipCode}
							<br />
							<span className="highText">Country:      </span>{user.countryofRecidence}
							<br />
							<h2>&nbsp;&nbsp;Emergency Contact:</h2>
							<span className="highText">Name:      </span>{user.ecName} <br />
							<span className="highText">Phone Number:      </span>{user.ecPhone}
							<br />
							<span className="highText">Email:       </span>{user.ecMail}<br />
							<span className="highText">City of Recidence:     </span> {user.countryofRecidence}
							<br />
							<br />
							<br />
						</p>
					</Container>
				</Row>
			</div>
		</div>
	);
}

export default ProfilE;
